import Button from "../Button";

const Nav = () => {
  return (
    <div>
      <Button
        btnTextCont="show / hide"
        onHandleClick={() => setGalleryVisibility(!isGalleryVisibile)}
      />
    </div>
  );
};

export default Nav;
